import React from "react"
import "./Books.css"
import { Link } from "react-router-dom"


export const BookCard = (book)=> {
    return(
    <section className="book">
        <h3><Link to={`/animals/detail/${book.id}`}>
            { book.title }
          </Link></h3>
        <div className="book__author">{book.author}</div>
        <div className="book__genre"></div>
        <div className="book__signed"></div>
        <div className="book__read"></div>
    </section>
    )
}
